import Button from "@material-ui/core/Button";


const paths = {
    start:
        "M0 1080L604.83 1080L1920 1080L1920 0L1368.9 0L0 0L0 1080Z",
    end :
        "M0 1080L518.75 1080L917.64 540L1164.84 426.45L1468.22 0L0 0L0 1080Z",
}


function StartAnimation(props){
    return(
      <div>
          <button className="startButton"
                  style={{position: "absolute"}}
                  onClick={this.goToNext}>
              Click me
          </button>
          <Spring
              from={{ opacity: 0 }}
              to={{ opacity: 1 }}>
              {props => (
                  <svg strokeDashoffset={props.x} preserveAspectRatio="none" viewBox="0 0 1980 1080">
                      <path d="M0 1080L518.75 1080L917.64 540L1164.84 426.45L1468.22 0L0 0L0 1080Z" id="bwq7GrOlX"></path>
                  </svg>
              )}
          </Spring>

          <Header/>
          <Area classes={{card: "4", media: "Hello", content: "ndawlndwalnidaw awdwadawd wadawd gregf"}}/>
      </div>
    );
}


export default StartAnimation;
